import React from 'react';
import AnnounceList from "~/components/AnnounceList";
import Header from "~/components/Header";

const Announce = () => {
  return (
    <div>
      <Header />
      <AnnounceList />
      <Footer />
    </div>
  );
};

export default Announce;
